import { BrowserRouter } from 'react-router-dom'
import { Login } from './Login'

function Home() {
	return (
		<>
			<BrowserRouter>
				<Routes path='/' element={<Login />} />
			</BrowserRouter>
		</>
	)
}

export default Home
